	/**
	 * 临界角的判定，包括范围和吸附
	 * @param curDeg 当前旋转角度
	 */
	function criticalAngle(curDeg) {
	  if (this.deg >= this.range[1]) {
	    this.dragState = 'max';
	  } else if (this.deg <= this.range[0]) {
	    this.dragState = 'min';
	  } else {
	    this.dragState = '';
	  }

	  if (this.dragState === 'max' && this.clockWise && curDeg > 0) {
	    // 顺时针并且deg还在增大，停止拖动
	    this.isMove = false;
	    this.deg = this.range[1];
	    this.setAngle(this.deg);
	    this.showHint();
	  } else if (this.dragState === 'min' && !this.clockWise && curDeg < 0) {
	    // 逆时针并且deg还在减小，停止拖动
