	/**
	 * 吸附条件判定
	 * @memberOf Rotate
	 */
	function absorbAngle() {
	  // 最小重合minMatchAngle，角度商数quotient
	  var minMatchAngle = 360 / this.symmetryNum;
	  // let quotient = Math.ceil(this.deg / minMatchAngle);
	  var quotient = Math.round(this.deg / minMatchAngle);
	  // 最接近当前角度的重合角度
	  var matchDeg = minMatchAngle * quotient;
	  var delta = Math.abs(matchDeg - this.deg);
	  // 更新重合角度数值
	  var num = parseInt(this.deg);
	  this.matchAngles = [];
	  this.maxAngle = num > this.maxAngle ? num + 5 : this.maxAngle;
	  this.minAngle = num < this.minAngle ? num : this.minAngle;

	  if (matchDeg < this.minMatchAngle && this.minAngle < matchDeg) {
	    this.minMatchAngle = matchDeg;
	  }
	  if (matchDeg > this.maxMatchAngle && this.maxAngle > matchDeg) {
	    this.maxMatchAngle = matchDeg;
	  }

	  var delta2 = this.maxMatchAngle - this.minMatchAngle;
	  if (delta2 >= 0) {
	    var length = parseInt(delta2 / minMatchAngle);
	    for (var i = 0; i < length + 1; i++) {
	      var angle = this.minMatchAngle + i * minMatchAngle;
	      this.matchAngles.push(angle + '°');
	    }
	  }
	  var str = this.matchAngles.toString().replace(/,/g, '、');
	  this.$matchNums.text(str);

	  // 小于正负5°吸附
	  if (delta < 5) {
	    this.setAngle(matchDeg);
	    // if (matchDeg < this.historyMinAngle) {
	    //   this.historyMinAngle = matchDeg
	    // }
	    if (matchDeg < this.minMatchAngle) {
	      this.minMatchAngle = matchDeg;
	    }
	    if (matchDeg > this.maxMatchAngle) {
	      this.maxMatchAngle = matchDeg;
	    }
	    this.$line.hide();
	  } else {
	    this.setAngle(this.deg);
	    this.$line.show();
	  }
	}
