	  deg = Math.acos((a * a + b * b - c * c) / (2 * a * b));
	  // 转化为角度制
	  deg = 180 * deg / Math.PI;
	  // 顺时针方向时判断p>0逆时针，p<0顺时针
	  var p = (posA[0] - posC[0]) * (posB[1] - posA[1]) - (posA[1] - posC[1]) * (posB[0] - posA[0]);
